def nopwithKInv(N, K): 

	# Base cases 
	if (N == 0): return 0
	if (K == 0): return 1

	if (memo[N][K] != -1): 
		return memo[N][K] % 2
	sum = 0
	for i in range(K + 1): 
		if (i <= N - 1): 
			sum += nopwithKInv(N - 1, K - i) % 2
	
	# store result into memo 
	memo[N][K] = sum % 2

	return sum % 2

